sentence2 = '浴室玻璃隔断+固定杆","content":"看了好多小红书的浴室隔断都好好看就也想要一个无边框的，但是沟通出错了原来想要的是靠墙用卡扣的结果不知道怎么变成这种卡槽了，不过也还可以。横杆是玻璃厂老板来装的时候说我玻璃太大了不安全，卡槽返工的时候自己又拿了几种玻璃固定杆让我选非给我装的（不要钱），不然只固定墙上一面地上打胶就会很晃。这种和三角形固定的我还是选了这个，好歹还能挂点东西。装之前老板问了好几遍你家有没有小孩，要是有小孩子无边框的这个不可以。我这边没有小孩子，有小孩也不会用这个卫生间所以完全没问题。买的时候销售都不会说，不会说家里有小孩不要选无边框，玻璃大需要固定之类的。'

