sentence4 = '山东省菏泽市中级人民法      院刑 事 裁 定 书（2017）鲁17刑更967号罪犯袁德朋，男，汉族，1980年1月2日出生于山东省曹县。现在山东省菏泽监狱服刑。>      二〇一五年二月十日，本院作出(2014)菏刑一初字第11号刑事附带民事判决，以被告人袁德朋犯故意伤害罪，判处有期徒刑十五年      。宣判后，被告人不服提出上诉。二一五年六月十一日，山东省高级人民法院作出(2015)鲁刑三终字第44号刑事附带民事裁定，驳      回上诉，维持原判。宣判后交付执行。执行机关山东省菏泽监狱于2017年11月22日提出减刑建议书，报送本院审理。本院依法组成      合议庭进行了审理。本案现已审理终结。执行机关山东省菏泽监狱,以罪犯袁德朋在服刑期间能认罪悔罪；认真遵守法律法规及监>      规；接受教育改造；积极参加思想、文化、职业技术教育；积极参加劳动，努力完成劳动任务，确有悔改表现等为由，提出予以减      刑建议。并附罪犯袁德朋在服刑期间的表现、奖励记录等书证。经审理查明，罪犯袁德朋在山东省菏泽监狱服刑改造期间认罪悔罪      ；认真遵守法律法规及监规；接受教育改造；积极参加思想、文化、职业技术教育；积极参加劳动，努力完成劳动任务。曾获表扬      四次；被评为2016年度监区级罪犯改造积极分子。另查明，该犯在服刑期间主动履行民事赔偿20873.7元。上述事实，有罪犯奖励>      审批表、计分考核明细表、领款条等证据予以证实。本院认为，罪犯袁德朋在服刑期间确有悔改表现，符合减刑条件。并结合其犯      罪的性质、具体情节、社会危害程度、原判刑罚及财产性判项的履行情况及交付执行后的一贯表现等因素，依照《中华人民共和国      刑事诉讼法》第二百六十二条第二款，《中华人民共和国刑法》第七十九条、第七十八条之规定，裁定如下：对罪犯袁德朋减去有      期徒刑八个月的刑罚执行。（刑期自2013年7月30日起至2027年11月29日止）本裁定送达后即发生法律效力。'

